window.bookSummaryJSON = "<p><b>Once upon a time, humankind ruled the world while lycans and vampires lived in secret. This is no longer that time.</b></p> <p><b>Juliet</b></p> <p>It is my duty to obey, to give my body and blood to a vampire master until he no longer has use for me. There is no escape. Nowhere to run. Follow the rules or die. I don't want to die.</p> <p><b>Darius </b></p> <p>Twenty-two years of conditioning has crafted the perfect poison-a weapon my enemies won't see coming. I'll break her, train her, and use her to take down everyone who stands in my way. She's alluring. She's perfect. And she's mine.</p> <p>Welcome to the future where the superior bloodlines make the rules. Proceed at your own risk.</p> <p><b>Contains mature themes.</b></p>"; 
